if(Cookies.get('sesion') == null && Cookies.getJSON('sesion')['permisos'] === true)
  window.location.replace("./index.html");

$('document').ready(function() {
  console.log('Logs');

  $.ajax({url: `http://localhost:3000/log`, method: `get`})
  .done(function(data) {
    html = ``;
    $.each(data, function(index, value) {
      html += `<tr>`;
      html += `<td>${value.ip}</td>`;
      html += `<td>${value.accion}</td>`;
      html += `<td>${value.fecha.substr(0, 10)}</td>`;
      html += `</tr>`;
    });
    $('#target').append(html);
  });

  $('#btn_estadisticas').on('click', function() {

    $.ajax({url: `http://localhost:3000/lineainovadora/estadisticas`, method: `get`})
    .done(function(data) {

      console.log(data);

      var linea = parseInt(data[0].linea);
      var produccion = parseInt(data[0].produccion);
      var proyecto = parseInt(data[0].proyecto);
      var direccion = parseInt(data[0].direccion);
      var estadia = parseInt(data[0].estadia);


      var total = linea + produccion + proyecto + direccion + estadia;

      linea = (linea / total) * 100;
      produccion = (produccion / total) * 100;
      proyecto = (proyecto / total) * 100;
      direccion = (direccion / total) * 100;
      estadia = (estadia / total) * 100;

      var total = linea + produccion + proyecto + direccion + estadia;
      console.log(`total: ${total}`);
      console.log(`linea: ${linea}`);
      console.log(`produccion: ${produccion}`);
      console.log(`proyecto: ${proyecto}`);
      console.log(`direccion: ${direccion}`);
      console.log(`estadia: ${estadia}`);
      // You'll need to make your image into a Data URL
      // Use http://dataurl.net/#dataurlmaker
      var imgData = 'data:image/jpeg;base64,'
      var doc = new jsPDF()

      doc.addImage(imgData, 'JPEG', 0, 0, 210, 220)

      var maxY = 43 / 100;

      // Filled square
      doc.rect(42, 110 - linea * maxY, 20, linea * maxY, 'F')

      // Filled square
      doc.rect(73, 110 - produccion * maxY, 20, produccion * maxY, 'F')

      // Filled square
      doc.rect(105, 110 - proyecto * maxY, 20, proyecto * maxY, 'F')

      // Filled square
      doc.rect(134, 110 - direccion * maxY, 20, direccion * maxY, 'F')

      // Filled square
      doc.rect(165, 110 - estadia * maxY, 20, estadia * maxY, 'F')

      doc.save('estadisticas.pdf')
    });

  });

});
